import React from "react";
import "./header.css";
import logo from "../resources/images/logo.png";

const Header = () => {
    return (
        <div className="header">
            <span className="header-logo">
                <img className="header-logo" src={logo} alt="#" />
            </span>
        </div>
    );
}

export default Header;
